def gcd(a, b):
	'''最大公約数'''
	while b != 0:
		a, b = b, a % b
	return a

def lcm(a, b):
	'''最小公倍数'''
	return (a * b) // gcd(a, b)

def ex_gcd(a, b):
	'''拡張ユークリッドアルゴリズム'''
	x1, x2 = 0, 1
	y1, y2 = 1, 0
	q = 0
	while b != 0:
		x1, x2 = x2, x1 - q * x2
		y1, y2 = y2, y1 - q * y2
		q = a // b
		a, b = b, a % b
	return a, x2, y2

def gcd_n(a, *numbers):
	'''複数の数の最大公約数'''
	d = a
	for b in numbers:
		d = gcd(d, b)
	return d

def lcm_n(a, *numbers):
	'''複数の数の最小公倍数'''
	m = a
	for b in numbers:
		m = lcm(m, b)
	return m

def factorize(n):
	'''素因数分解'''
	factor = 2
	factors = []
	while factor * factor <= n:
		if n % factor == 0:
			count = 1
			n //= factor
			while n % factor == 0:
				n //= factor
				count += 1
			factors.append((factor, count))
		factor += 1
	if n != 1:
		factors.append((n, 1))
	return factors

def totient(n):
	'''オイラーのトーシェント関数'''
	phi = 1
	for prime, count in factorize(n):
		phi *= (prime - 1) * (prime ** (count - 1))
	return phi

def carmichael(n):
	'''カーマイケル関数'''
	prime_carmichaels = [1]
	for prime, count in factorize(n):
		if prime == 2:
			prime_carmichaels.append(count if count <= 2 else (2 ** (count - 2)))
		else:
			prime_carmichaels.append((prime - 1) * (prime ** (count - 1)))
	return lcm_n(*prime_carmichaels)


class Modulo (object):
	def __init__(self, mod):
		self.mod = mod
		self.carmichael = carmichael(mod)

	def add(self, x, y):
		return (x + y) % self.mod

	def sub(self, x, y):
		return (x - y) % self.mod

	def mul(self, x, y):
		return (x * y) % self.mod

	def div(self, x, y):
		return self.mul(x, self.inv(y))

	def inv(self, x):
		return self.pow(x, self.carmichael - 1)

	def pow(self, x, count):
		return pow(x, count, self.mod)


