def solve(edges, h):
    neighbors = [set() for x in range(len(h)+1)]
    for edge in edges:
        neighbors[edge[0]].add(edge[1])
        neighbors[edge[1]].add(edge[0])
    result = -1
    for i, node in enumerate(neighbors):
        height = h[i-1]
        good = True
        for neighbor in node:
            if height <= h[neighbor-1]:
                good = False
                break
        if good:
            result += 1
    return result


