def solve(s, k):
    n = len(s)
    if k >= n // 2:
        return n
    pdp = [[0] * (k + 1)]
    for l in range(1, n + 1):
        i = n - l
        dp = [[0] * (k + 1) for _ in range(l + 1)]
        dpr1, pdpr1 = dp[-1], [0] * (k + 1)
        for r in range(l):
            dpr, pdpr = dp[r], pdp[r - 1]
            inc = 2 if r else 1
            if s[i] == s[i + r]:
                for p in range(k + 1):
                    dp[r] = [c + inc for c in pdpr1]
            else:
                dpr[0] = max(pdpr[0], dpr1[0])
                for p in range(1, k + 1):
                    dpr[p] = max(pdpr[p], dpr1[p], pdpr1[p - 1] + inc)
            dpr1, pdpr1 = dpr, pdpr
        pdp = dp

    return pdp[-2][k]


