def main():
    s = input()
    n = len(s)
    k = int(input())
    # dp[左端][左端からの右端の距離][使った回数]
    dp = [[[2]*(k+1) for _ in [0]*(n-i)] for i in range(n)]

    for i in range(n):
        for cnt in range(k+1):
            dp[i][0][cnt] = 1

    for i in range(n-1):
        if s[i] != s[i+1]:
            dp[i][1][0] = 1

    for cnt in range(k):
        for d in range(2, n):
            for left in range(n-d):
                right = left+d
                plus = (s[left] == s[right])*2
                dp[left][d][cnt] = max(
                    dp[left][d][cnt], dp[left][d-1][cnt],
                    dp[left+1][d-1][cnt], dp[left+1][d-2][cnt]+plus)
                dp[left][d][cnt+1] = max(
                    max(dp[left][d][cnt:cnt+2]), dp[left+1][d-2][cnt]+2)
    for d in range(2, n):
        for left in range(n-d):
            right = left+d
            plus = (s[left] == s[right])*2
